import React from 'react'
import classes from './Modal.module.css'

const Modal = (props) => {
    if (props.showModal){
        let child = (
            <div className = {classes.Modal}>
                {props.children}
            </div>
        )
    }
    return (
        <div className = {classes.Modal}>
            {props.children}
        </div>
        )
    }
    


export default Modal
